<html>
<head>
<script language="javascript">
function show_tomato()
{
	document.getElementById("splash").style.display = "none";
	document.getElementById("tomato").style.display = "inline";
}

function show_splash()
{
	document.getElementById("tomato").style.display = "none";
	document.getElementById("splash").style.display = "inline";
}

function randomize()
{
	show_splash();
	
	setTimeout(function()
	{
		document.getElementById("main").style.top = Math.random() * (window.innerHeight - 250);
		document.getElementById("main").style.left = Math.random() * (window.innerWidth - 250);
		
		show_tomato();
	}, 3000);
}
</script>
</head>
